import React, { Component } from "react";
import Hero from "./Hero";

class HeroList extends Component {
  render() {
    return (
      <div className="container">
        this.props.heroes.map(hero => <Hero hero={hero} />
        );
      </div>
    );
  }
}

export default HeroList;
